sap.ui.define(["sap/ui/core/mvc/Controller"],function(e){"use strict";return e.extend("com.app.Application.controller.App",{onInit:function(){},onSave:function(){if(this.validateCells()){sap.m.MessageToast.show("Table Saved Successfully")}else{sap.m.MessageToast.show("Table cells are empty or invalid!")}},validateCells:function(){var e=this.getView().byId("idTable");var t=true;for(var l=0;l<e.getItems().length;l++){if(!e.getItems()[l].getCells()[0].getValue()){e.getItems()[l].getCells()[0].setValueState("Error");t=false}else{e.getItems()[l].getCells()[0].setValueState("None")}if(!e.getItems()[l].getCells()[1].getValue()){e.getItems()[l].getCells()[1].setValueState("Error");t=false}else{e.getItems()[l].getCells()[1].setValueState("None")}if(!e.getItems()[l].getCells()[2].getValue()){e.getItems()[l].getCells()[2].setValueState("Error");t=false}else{e.getItems()[l].getCells()[2].setValueState("None")}if(e.getItems()[l].getCells()[3].getSelectedKey()==="-Select-"){e.getItems()[l].getCells()[3].setValueState("Error");t=false}else{e.getItems()[l].getCells()[3].setValueState("None")}if(!e.getItems()[l].getCells()[4].getValue()){e.getItems()[l].getCells()[4].setValueState("Error");t=false}else{e.getItems()[l].getCells()[4].setValueState("None")}if(!e.getItems()[l].getCells()[5].getValue()){e.getItems()[l].getCells()[5].setValueState("Error");t=false}else if(e.getItems()[l].getCells()[5].getValue().length<10){e.getItems()[l].getCells()[5].setValueState("Error");t=false}else{e.getItems()[l].getCells()[5].setValueState("None")}}return t}})});